import React from "react";
import Link from "next/link";
const NavBar = () => {
  return (
    <div>
      <nav>
        <menu>
          <Link href="/">
            <a>Home</a>
          </Link>

          <Link href="/about">
            <a>About</a>
          </Link>

          <Link href="/products">
            <a>Products</a>
          </Link>
        </menu>
      </nav>
    </div>
  );
};

export default NavBar;
